	module.exports = {"layout":"post","title":"动手写一个简单的 Virtual Dom（2）","datePublished":"2016-06-05 11:21:04","tags":"React","body":"<p>上一篇文章其实就是介绍了怎么创建虚拟 DOM，真的只是创建 DOM 元素而已，因为没有设置属性的功能，事件绑定的功能也没有。\n现在慢慢的一个个来实现吧。</p>\n<h2>设置属性</h2>\n<p>设置属性很简单的，还记得前面我们怎么表达 DOM 的吗? 我们把属性用纯 JS 对象存起来，比如：</p>\n<pre><code class=\"language-html\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ul</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">”list”</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">”list-style:</span> <span class=\"hljs-attr\">none</span>;”&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ul</span>&gt;</span>\n</code></pre>\n<p>用 JS 对象来表达这个 DOM，就会是下面这个样子：</p>\n<pre><code class=\"language-js\">{ \n  type: ‘ul’, \n  props: { className: ‘list’, style: ’list-style: none;’ } \n  children: []\n}\n</code></pre>\n<p>上面对象的每个字段就是属性名称，字段的值就是属性的值了。我们只要把这个对象映射到 DOM节点上去就可以啦。\n可以利用 <code>setAttribute()</code> 方法来写一个设置属性的函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">setProp</span>(<span class=\"hljs-params\">$target, name, value</span>) </span>{\n  $target.setAttribute(name, value);\n}\n</code></pre>\n<p>我们既然知道在 JS 里设置一个属性，那么可以通过遍历把对象里的每个字段设置成属性：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">setProps</span>(<span class=\"hljs-params\">$target, props</span>) </span>{\n  <span class=\"hljs-built_in\">Object</span>.keys(props).forEach(name =&gt; {\n    setProp($target, name, props[name]);\n  });\n}\n</code></pre>\n<p>接下来我们要用到上篇文章提到的 <code>createElement()</code> 函数。在创建 DOM 后引用 <code>setProps()</code> 函数</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">createElement</span>(<span class=\"hljs-params\">node</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-keyword\">typeof</span> node === ‘string’) {\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-built_in\">document</span>.createTextNode(node)\n  }\n  <span class=\"hljs-keyword\">const</span> $el = <span class=\"hljs-built_in\">document</span>.createElement(node.type)\n  setProps($el, node.props)\n  node.children\n    .map(createElement)\n    .forEach($el.appendChild.bind($el))\n  <span class=\"hljs-keyword\">return</span> $el\n}\n</code></pre>\n<p>到这里还没完，还有几个需要注意的小地方。首先 class 在 JS 关键字，需要用 ‘className’ 代替：</p>\n<pre><code class=\"language-html\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">nav</span> <span class=\"hljs-attr\">className</span>=<span class=\"hljs-string\">”navbar</span> <span class=\"hljs-attr\">light</span>”&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ul</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ul</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">nav</span>&gt;</span>\n</code></pre>\n<p>但是因为 DOM 里面是没有 <code>className</code> 这个属性的，所以需要我们自己利用 <code>setProp()</code> 函数去设置。</p>\n<p>还有一个注意的地方就是，我们经常在 DOM 里面要用到一些布尔属性，比如：</p>\n<pre><code><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">input</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">”checkbox”</span> <span class=\"hljs-attr\">checked</span>=<span class=\"hljs-string\">{false}</span> /&gt;</span>\n</code></pre>\n<p>前面写了一个设置元素标签属性的 <code>setProp</code> 函数，现在需要再写一个设置元素标签属性布尔值的函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">setBooleanProp</span>(<span class=\"hljs-params\">$target, name, value</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (value) {\n    $target.setAttribute(name, value);\n    $target[name] = <span class=\"hljs-literal\">true</span>;\n  } <span class=\"hljs-keyword\">else</span> {\n    $target[name] = <span class=\"hljs-literal\">false</span>;\n  }\n}\n</code></pre>\n<p>还有一个需要注意的就是我们有的时候可能会自己定义一个属性在 DOM 元素上，像这种情况我们需要检查如果是自定义的不存在的属性，我们\n返回 false：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">isCustomProp</span>(<span class=\"hljs-params\">name</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> <span class=\"hljs-literal\">false</span>;\n}\n</code></pre>\n<p>现在我们把 <code>setBooleanProp</code>，<code>isCustomProp</code>添加到 <code>setProp</code> 实现一个完整的设置属性的功能函数</p>\n<pre><code><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span></span> setProp($<span class=\"hljs-keyword\">target</span>, <span class=\"hljs-keyword\">name</span>, <span class=\"hljs-keyword\">value</span>) {\n  <span class=\"hljs-keyword\">if</span> (isCustomProp(<span class=\"hljs-keyword\">name</span>)) {\n    <span class=\"hljs-keyword\">return</span>;\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-keyword\">name</span> === ‘className’) {\n    $<span class=\"hljs-keyword\">target</span>.setAttribute(‘<span class=\"hljs-keyword\">class</span>’, <span class=\"hljs-keyword\">value</span>);\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (typeof <span class=\"hljs-keyword\">value</span> === ‘boolean’) {\n    setBooleanProp($<span class=\"hljs-keyword\">target</span>, <span class=\"hljs-keyword\">name</span>, <span class=\"hljs-keyword\">value</span>)\n  } <span class=\"hljs-keyword\">else</span> {\n    $<span class=\"hljs-keyword\">target</span>.setAttribute(<span class=\"hljs-keyword\">name</span>, <span class=\"hljs-keyword\">value</span>)\n  }\n}\n</code></pre>\n<p>上一篇讲创建 DOM 的时候有写到进行 DOM diff，其实现在这个属性也要进行 props diff。当然 diff\n无非几种情况，删除属性，添加属性，更新属性这几种。</p>\n<p>下面是删除属性的具体的函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">removeBooleanProp</span>(<span class=\"hljs-params\">$target, name</span>) </span>{\n  $target.removeAttribute(name);\n  $target[name] = <span class=\"hljs-literal\">false</span>;\n}\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">removeProp</span>(<span class=\"hljs-params\">$target, name, value</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (isCustomProp(name)) {\n    <span class=\"hljs-keyword\">return</span>;\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (name === ‘className’) {\n    $target.removeAttribute(‘<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span>’)</span>;\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-keyword\">typeof</span> value === ‘boolean’) {\n    removeBooleanProp($target, name);\n  } <span class=\"hljs-keyword\">else</span> {\n    $target.removeAttribute(name);\n  }\n}\n</code></pre>\n<p>我们还需要一个 updateProp 的函数来比较DOM标签上新旧属性的区别并且更新最后的 DOM。细想一下应该主要就是\n下面几种情况：</p>\n<ul>\n<li>添加属性，指的是本来 DOM 标签上一个属性都没有，添加了一个属性</li>\n<li>把属性删除了，和上面想反</li>\n<li>删除属性值，可能一个属性里面本来有多个值，现在删了一个，比如本来 DOM class 属性有两个值的，现在删了一个</li>\n<li>添加属性值，和上面相反</li>\n</ul>\n<p>对于一个属性的更新可以这么写：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">updateProp</span>(<span class=\"hljs-params\">$target, name, newVal, oldVal</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (!newVal) {\n    removeProp($target, name, oldVal);\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (!oldVal || newVal !== oldVal) {\n    setProp($target, name, newVal);\n  }\n}\n</code></pre>\n<p>对于所有的属性则可以和前面设置属性一样通过遍历来实现：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">updateProps</span>(<span class=\"hljs-params\">$target, newProps, oldProps = {}</span>) </span>{\n  <span class=\"hljs-keyword\">const</span> props = <span class=\"hljs-built_in\">Object</span>.assign({}, newProps, oldProps);\n  <span class=\"hljs-built_in\">Object</span>.keys(props).forEach(name =&gt; {\n    updateProp($target, name, newProps[name], oldProps[name]);\n  });\n}\n</code></pre>\n<p>好了，属性也更新了，最后就是更新DOM元素了，在第一篇文章里我们写了一个 updateElement函数，现在我们来更新一下这个函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">updateElement</span>(<span class=\"hljs-params\">$parent, newNode, oldNode, index = 0</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (!oldNode) {\n    $parent.appendChild(\n      createElement(newNode)\n    );\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (!newNode) {\n    $parent.removeChild(\n      $parent.childNodes[index]\n    );\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (changed(newNode, oldNode)) {\n    $parent.replaceChild(\n      createElement(newNode),\n      $parent.childNodes[index]\n    );\n  } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (newNode.type) {\n    <span class=\"hljs-comment\">// 新添加的代码</span>\n    updateProps(\n      $parent.childNodes[index],\n      newNode.props,\n      oldNode.props\n    ); <span class=\"hljs-comment\">//</span>\n\n    <span class=\"hljs-keyword\">const</span> newLength = newNode.children.length;\n    <span class=\"hljs-keyword\">const</span> oldLength = oldNode.children.length;\n    <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">let</span> i = <span class=\"hljs-number\">0</span>; i &lt; newLength || i &lt; oldLength; i++) {\n      updateElement(\n        $parent.childNodes[index],\n        newNode.children[i],\n        oldNode.children[i],\n        i\n      );\n    }\n  }\n}\n</code></pre>\n<p>最后我把上面的代码整理一下在 jsfiddle 上： <a href=\"https://jsfiddle.net/gothic/a1c4qky5/\">https://jsfiddle.net/gothic/a1c4qky5/</a></p>\n"}

