	module.exports = {"layout":"post","title":"动手写一个简单的 Virtual Dom（3）","datePublished":"2016-06-06 11:21:04","tags":"React","body":"<p>前一篇文章介绍了 Virtual Dom 的属性设置等，现在再讲一下  Virtual Dom 怎么绑定事件。\n平常我们给 DOM 绑定事件的写法可能是这样：<code>querySelector('xx').addEventListener(..)</code>\n但是在 React 里面我们不这样写，我们直接在 DOM 上通过属性来绑定：</p>\n<pre><code><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">button</span> <span class=\"hljs-attr\">onClick</span>=<span class=\"hljs-string\">{()</span> =&gt;</span> alert(‘hi!’)}&gt;<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">button</span>&gt;</span>\n</code></pre>\n<p>上面我们有一个专门监听事件的属性，并且都以 ‘on’ 开头，下面我们写一个函数来判断该属性是不是绑定事件的：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">isEventProp</span>(<span class=\"hljs-params\">name</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> <span class=\"hljs-regexp\">/^on/</span>.test(name);\n}\n</code></pre>\n<p>下面我们还需要一个方法来从属性里面把 事件属性名给提出来：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">extractEventName</span>(<span class=\"hljs-params\">name</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> name.slice(<span class=\"hljs-number\">2</span>).toLowerCase();\n}\n</code></pre>\n<p>现在还有个问题就是我们这个监听事件的属性其实和其他的正常属性是不一样的，所以我们需要在 isCustomProp 里面\n处理这个属性：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">isCustomProp</span>(<span class=\"hljs-params\">name</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> isEventProp(name);\n}\n</code></pre>\n<p>接下来就是真正的给 Dom 监听事件的属性添加监听函数了：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">addEventListeners</span>(<span class=\"hljs-params\">$target, props</span>) </span>{\n  <span class=\"hljs-built_in\">Object</span>.keys(props).forEach(name =&gt; {\n    <span class=\"hljs-keyword\">if</span> (isEventProp(name)) {\n      $target.addEventListener(\n        extractEventName(name),\n        props[name]\n      );\n    }\n  });\n}\n</code></pre>\n<p>然后把上面这个放到 <code>createElement</code> 里面去：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">createElement</span>(<span class=\"hljs-params\">node</span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-keyword\">typeof</span> node === ‘string’) {\n    <span class=\"hljs-keyword\">return</span> <span class=\"hljs-built_in\">document</span>.createTextNode(node);\n  }\n  <span class=\"hljs-keyword\">const</span> $el = <span class=\"hljs-built_in\">document</span>.createElement(node.type);\n  setProps($el, node.props);\n  addEventListeners($el, node.props);\n  node.children\n    .map(createElement)\n    .forEach($el.appendChild.bind($el));\n  <span class=\"hljs-keyword\">return</span> $el;\n}\n</code></pre>\n<p>到这里监听事件的功能基本上就好了，但是还有一个小问题，就是重复添加事件的问题，虽然这个需求很少，但是还是不可避免的会有，\n所以我们可以添加一个强制更新的属性 ‘forceUpdate’，然后修改之前的那个 change 函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">changed</span>(<span class=\"hljs-params\">node1, node2</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">typeof</span> node1 !== <span class=\"hljs-keyword\">typeof</span> node2 ||\n         <span class=\"hljs-keyword\">typeof</span> node1 === ‘string’ &amp;&amp; node1 !== node2 ||\n         node1.type !== node2.type ||\n         node.props.forceUpdate;\n}\n</code></pre>\n<p>当 ‘forceUpdate’ 为 true 时，这个 Dom 节点会完全重新重新创建并且把事件监听加上，这里就还需要修改下之前的 isCustomProp 函数：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">isCustomProp</span>(<span class=\"hljs-params\">name</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> isEventProp(name) || name === ‘forceUpdate’;\n}\n</code></pre>\n<p>下面是完整的 DEMO：<a href=\"https://jsfiddle.net/gothic/as87qdyc/3/\">https://jsfiddle.net/gothic/as87qdyc/3/</a></p>\n"}

