	module.exports = {"layout":"post","title":"CSS 实现下划线的几个姿势总结","datePublished":"2016-10-19 11:21:04","category":"CSS","body":"<p>下划线在我们的 web 设计里很常见，有些设计可能很特别，需要仔细思考用哪个方法才能实现最佳效果</p>\n<pre><code class=\"language-html\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h1</span>&gt;</span>0.text-decoration: underline<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h1</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a0\"</span>&gt;</span>下划线，woshiyiwnwen<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h1</span>&gt;</span>1.border-bottom<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h1</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a1\"</span>&gt;</span>下划线，woshiyiwnwen<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h2</span>&gt;</span>2.伪元素的 border-bottom<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h2</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a2\"</span>&gt;</span>下划线 woshiyinwei<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h2</span>&gt;</span>3. box-shadow<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h2</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a3\"</span>&gt;</span>下划线 woshiyinwe<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h2</span>&gt;</span>4.背景线性渐变<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h2</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">p</span>&gt;</span><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a4\"</span>&gt;</span>下划线woshiyin<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">p</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h2</span>&gt;</span>5.svg filter<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h2</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">p</span>&gt;</span><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">a</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"a5\"</span>&gt;</span>下划线woshiyin<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">a</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">p</span>&gt;</span>\n \n <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">svg</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"visuallyHidden\"</span>&gt;</span>\n\n  <span class=\"hljs-comment\">&lt;!-- Base 0.0 to 1.0 values on the size of the bounding box.\n       Essentially turn them into viewport units or percentages. --&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">filter</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"svg-underline\"</span> <span class=\"hljs-attr\">primitiveUnits</span>=<span class=\"hljs-string\">\"objectBoundingBox\"</span>&gt;</span>\n    \n    <span class=\"hljs-comment\">&lt;!-- Take the original image (the text) and expand it a little\n         horizontally and a little more vertically. Then store it\n         in a new layer. --&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feMorphology</span> <span class=\"hljs-attr\">in</span>=<span class=\"hljs-string\">\"SourceGraphic\"</span> <span class=\"hljs-attr\">operator</span>=<span class=\"hljs-string\">\"dilate\"</span> <span class=\"hljs-attr\">radius</span>=<span class=\"hljs-string\">\"0.0075 0.05\"</span> <span class=\"hljs-attr\">result</span>=<span class=\"hljs-string\">\"outline\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feMorphology</span>&gt;</span>\n    \n    <span class=\"hljs-comment\">&lt;!-- Make a blue rectangle that’s 3% tall and 100% wide and expand it\n         a little horizontally and a position it below the original text. --&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feFlood</span> <span class=\"hljs-attr\">flood-color</span>=<span class=\"hljs-string\">\"blue\"</span> <span class=\"hljs-attr\">width</span>=<span class=\"hljs-string\">\"1\"</span> <span class=\"hljs-attr\">height</span>=<span class=\"hljs-string\">\"0.03\"</span> <span class=\"hljs-attr\">x</span>=<span class=\"hljs-string\">\"0\"</span> <span class=\"hljs-attr\">y</span>=<span class=\"hljs-string\">\"0.85\"</span> <span class=\"hljs-attr\">result</span>=<span class=\"hljs-string\">\"underline\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feFlood</span>&gt;</span>\n    \n    <span class=\"hljs-comment\">&lt;!-- Take the blue rectange and use the expanded text layer to mask\n         out the parts we don’t want. This is where it skips descenders. --&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feComposite</span> <span class=\"hljs-attr\">in</span>=<span class=\"hljs-string\">\"underline\"</span> <span class=\"hljs-attr\">in2</span>=<span class=\"hljs-string\">\"outline\"</span> <span class=\"hljs-attr\">operator</span>=<span class=\"hljs-string\">\"out\"</span> <span class=\"hljs-attr\">result</span>=<span class=\"hljs-string\">\"underline\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feComposite</span>&gt;</span>\n    \n    <span class=\"hljs-comment\">&lt;!-- Now stack the underline and the original text for export. --&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feMerge</span>&gt;</span>\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feMergeNode</span> <span class=\"hljs-attr\">in</span>=<span class=\"hljs-string\">\"underline\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feMergeNode</span>&gt;</span>\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">feMergeNode</span> <span class=\"hljs-attr\">in</span>=<span class=\"hljs-string\">\"SourceGraphic\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feMergeNode</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">feMerge</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">filter</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">svg</span>&gt;</span>\n</code></pre>\n<pre><code class=\"language-css\"><span class=\"hljs-selector-class\">.a0</span> {\n  <span class=\"hljs-attribute\">text-decoration</span>: underline;\n  <span class=\"hljs-comment\">/* 仅Firfox,Safari 支持 */</span>\n  <span class=\"hljs-attribute\">text-decoration-style</span>: dotted;\n  <span class=\"hljs-attribute\">text-decoration-color</span>: red;\n}\n<span class=\"hljs-selector-class\">.a1</span> {\n    <span class=\"hljs-attribute\">text-decoration</span>: none;\n    <span class=\"hljs-attribute\">border-bottom</span>: <span class=\"hljs-number\">0.1em</span> dashed <span class=\"hljs-number\">#1AC63A</span>;\n    <span class=\"hljs-attribute\">padding-bottom</span>: .<span class=\"hljs-number\">1em</span>;\n}\n<span class=\"hljs-selector-class\">.a2</span> {\n\n    <span class=\"hljs-attribute\">display</span>: inline-block;\n    <span class=\"hljs-attribute\">position</span>: relative;\n        <span class=\"hljs-attribute\">text-decoration</span>: none;\n    \n}\n<span class=\"hljs-selector-class\">.a2</span><span class=\"hljs-selector-pseudo\">::after</span> {\n    <span class=\"hljs-attribute\">content</span>: <span class=\"hljs-string\">''</span>;\n    <span class=\"hljs-attribute\">position</span>: absolute;\n    <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">0</span>;\n    <span class=\"hljs-attribute\">display</span>: inline-block;\n    <span class=\"hljs-attribute\">height</span>: <span class=\"hljs-number\">1em</span>;\n    <span class=\"hljs-attribute\">width</span>: <span class=\"hljs-number\">100%</span>;\n    <span class=\"hljs-attribute\">border-bottom</span>: <span class=\"hljs-number\">1px</span> solid;\n    <span class=\"hljs-attribute\">margin-top</span>: <span class=\"hljs-number\">5px</span>;\n}\n<span class=\"hljs-selector-class\">.a3</span> {\n  <span class=\"hljs-attribute\">text-decoration</span>: none;\n  <span class=\"hljs-attribute\">box-shadow</span>: <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">1px</span> <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">0</span> currentColor;\n}\n<span class=\"hljs-selector-class\">.a4</span> {\n     <span class=\"hljs-attribute\">background-image</span>: <span class=\"hljs-built_in\">-webkit-linear-gradient</span>(left, blue 75%, transparent 75%);\n    <span class=\"hljs-attribute\">background-image</span>: <span class=\"hljs-built_in\">linear-gradient</span>(to right, blue 75%, transparent 75%);\n    <span class=\"hljs-attribute\">background-position</span>: <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">15px</span>;\n    <span class=\"hljs-attribute\">background-repeat</span>: repeat-x;\n    <span class=\"hljs-attribute\">background-size</span>: <span class=\"hljs-number\">8px</span> <span class=\"hljs-number\">3px</span>;\n}\n<span class=\"hljs-selector-class\">.a5</span> {\n    <span class=\"hljs-attribute\">-webkit-filter</span>: <span class=\"hljs-built_in\">url</span>(<span class=\"hljs-string\">'#svg-underline'</span>);\n    <span class=\"hljs-attribute\">filter</span>: <span class=\"hljs-built_in\">url</span>(<span class=\"hljs-string\">'#svg-underline'</span>);\n    <span class=\"hljs-attribute\">text-decoration</span>: none;\n}\n</code></pre>\n<p>在线 DEMO： <a href=\"http://jsfiddle.net/gothic/h5t8vzhj\">jsfiddle.net/gothic/h5t8vzhj</a></p>\n"}

