	module.exports = {"layout":"post","title":"ReactNative ImagePickerIOS 使用教程","datePublished":"2016-10-23 11:21:04","category":"react-native","body":"<p>ImagePickerIOS 是 RN 里面的一个获取图片的 API，不过这个API只是在 IOS平台用的。但是官方文档只有简单的几个方法名：</p>\n<pre><code>static canRecordVideos(<span class=\"hljs-name\">callback</span>) \nstatic canUseCamera(<span class=\"hljs-name\">callback</span>) \nstatic openCameraDialog(<span class=\"hljs-name\">config</span>, successCallback, cancelCallback) \nstatic openSelectDialog(<span class=\"hljs-name\">config</span>, successCallback, cancelCallback) \n</code></pre>\n<p>一开始以为这个 API 能够直接用，试了一下发现没有用，因为这个 API 是原生的功能模块，所以要在项目里设置一下才能用。\n具体也很简单，和使用其他的第三方RN原生模块一样，要把模块添加到Libraries里面</p>\n<p>创建项目</p>\n<p>react-native init rnimage</p>\n<p>用 Xcod 打开项目，开始设置，整个过程基本就是这三个图</p>\n<p><img src=\"http://i.imgur.com/q99upIC.jpg\" alt=\"Imgur\"></p>\n<p><img src=\"http://i.imgur.com/bRlRSuU.jpg\" alt=\"Imgur\"></p>\n<p>把 node_modules/react-native/Libraries/CameraRoll 拖到 Libraries 里面去</p>\n<p><img src=\"http://i.imgur.com/FWLO7XN.jpg\" alt=\"Imgur\">\n在 BuildPhases 里面link Binary With Libraries 里面添加 libRCTCameraRoll</p>\n<p>设置好后就可以在JS代码里直接用了</p>\n<pre><code class=\"language-js\"><span class=\"hljs-keyword\">import</span> React, { Component } <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>;\n<span class=\"hljs-keyword\">import</span> {\n  AppRegistry,\n  Text,\n  View,\n  ImagePickerIOS,\n  InteractionManager,\n  Image,\n} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react-native'</span>;\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">rnimage</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  <span class=\"hljs-keyword\">constructor</span>() {\n    <span class=\"hljs-keyword\">super</span>();\n    <span class=\"hljs-keyword\">this</span>.state = { image: <span class=\"hljs-literal\">null</span> };\n  }\n\n  componentDidMount() {\n    <span class=\"hljs-keyword\">this</span>.pickImage();\n  }\n\n  pickImage() {\n    ImagePickerIOS.canRecordVideos(() =&gt; alert(<span class=\"hljs-string\">'能获取视频'</span>))\n    \n    ImagePickerIOS.canUseCamera(() =&gt; alert(<span class=\"hljs-string\">'能获取图片'</span>))\n     <span class=\"hljs-comment\">// openSelectDialog(config, successCallback, errorCallback);</span>\n    ImagePickerIOS.openSelectDialog({}, () =&gt; {\n      <span class=\"hljs-keyword\">this</span>.setState({ image: imageUri });\n    }, error =&gt; <span class=\"hljs-built_in\">console</span>.error(error));\n  }\n\n\n  render() {\n    <span class=\"hljs-keyword\">return</span> (\n      <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">View</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{{</span> <span class=\"hljs-attr\">flex:</span> <span class=\"hljs-attr\">1</span>,<span class=\"hljs-attr\">padding:</span> <span class=\"hljs-attr\">15</span> }}&gt;</span>\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">Text</span>&gt;</span>ImagePickerIOS<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">Text</span>&gt;</span>\n        {this.state.image?\n          <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">Image</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{{</span> <span class=\"hljs-attr\">flex:</span> <span class=\"hljs-attr\">1</span>}} <span class=\"hljs-attr\">source</span>=<span class=\"hljs-string\">{{</span> <span class=\"hljs-attr\">uri:</span> <span class=\"hljs-attr\">this.state.image</span> }} /&gt;</span> :\n          null\n        }\n      <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">View</span>&gt;</span>\n    );\n  }\n}\nAppRegistry.registerComponent('rnimage', () =&gt; rnimage);\n</span></code></pre>\n<p>整个 demo 在 Github 上 <a href=\"https://github.com/Code-In-Action/ReactNative-in-action/tree/master/rnimage\">https://github.com/Code-In-Action/ReactNative-in-action/tree/master/rnimage</a></p>\n"}

