	module.exports = {"layout":"post","title":"一次 H5 活动页面的图片优化","datePublished":"2016-11-26 11:21:04","category":"web 优化","body":"<p>上周做了一个 APP 里的 HTML5 活动页面，因为后端那边忙不能及时给我提供数据，所以有时间想着怎么把这个活动页面做好一点。</p>\n<p>之前我们的活动页面包括 H5 页面已经做过一些优化，但是有两个东西我一直想尝试并没有去落地，就是 webp 和 类似 medium 那样的图片加载效果，刚好这次打算用到活动页面里面来试一下。\n先说下怎么实现类似 medium 那种图片加载效果</p>\n<p>首先我们去看一下 medium 的效果并扒下源码，发现文章里的图片 HTML 结果基本上是这个样子的，figure 是一个 H5的新标签，用来包含一组独立的内容(图片，音频等)，\n其中 aspectRatioPlaceholder-fill 元素是个占位符，并将它的 padding-bottom设置成百分比和图片长宽一致，\n就是图片还没加载出的时候显示图片宽度和高度，避免页面塌陷又突然张开体验不好，\n然后 progressiveMedia-thumbnail 这个图片是一个很小很小的类似缩略图，先加载这个小图片并用 canvas 元素生成一个高斯模糊的背景覆盖在前面的小图片上，\n然后插入原图等到后面的原图加载完毕则把前面的这些缩略图 canvas 等隐藏，最后显示原大图。</p>\n<p>PS: medium 细节做的不错，还加了一个禁止 js 情况下(noscript)的展示情况</p>\n<pre><code>&lt;figure <span class=\"hljs-built_in\">name</span>=<span class=\"hljs-string\">\"a7a6\"</span> <span class=\"hljs-built_in\">id</span>=<span class=\"hljs-string\">\"a7a6\"</span> <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"graf graf--figure graf--layoutConstrainedHeightPreview graf-after--h3 graf--last\"</span>&gt;\n  &lt;<span class=\"hljs-keyword\">div</span> <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"aspectRatioPlaceholder is-locked\"</span> style=<span class=\"hljs-string\">\"max-width: 331.31531531531533px; max-height: 240px;\"</span>&gt;\n    &lt;<span class=\"hljs-keyword\">div</span> <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"aspectRatioPlaceholder-fill\"</span> style=<span class=\"hljs-string\">\"padding-bottom: 72.39999999999999%;\"</span>&gt;&lt;/<span class=\"hljs-keyword\">div</span>&gt;\n    &lt;<span class=\"hljs-keyword\">div</span> <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"progressiveMedia js-progressiveMedia graf-image is-canvasLoaded is-imageLoaded\"</span> data-image-<span class=\"hljs-built_in\">id</span>=<span class=\"hljs-string\">\"1*eXEz9RrAjIWLz0MtQqq6Pg.jpeg\"</span> data-width=<span class=\"hljs-string\">\"4597\"</span> data-height=<span class=\"hljs-string\">\"3330\"</span> data-scroll=<span class=\"hljs-string\">\"native\"</span>&gt;\n      &lt;img src=<span class=\"hljs-string\">\"https://cdn-images-1.medium.com/freeze/max/30/1*eXEz9RrAjIWLz0MtQqq6Pg.jpeg?q=20\"</span> crossorigin=<span class=\"hljs-string\">\"anonymous\"</span> <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"progressiveMedia-thumbnail js-progressiveMedia-thumbnail\"</span>&gt;\n      &lt;canvas <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"progressiveMedia-canvas js-progressiveMedia-canvas\"</span> width=<span class=\"hljs-string\">\"75\"</span> height=<span class=\"hljs-string\">\"52\"</span>&gt;&lt;/canvas&gt;\n      &lt;img <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"progressiveMedia-image js-progressiveMedia-image\"</span> \n            data-src=<span class=\"hljs-string\">\"https://cdn-images-1.medium.com/max/331/1*eXEz9RrAjIWLz0MtQqq6Pg.jpeg\"</span> \n            src=<span class=\"hljs-string\">\"https://cdn-images-1.medium.com/max/331/1*eXEz9RrAjIWLz0MtQqq6Pg.jpeg\"</span>&gt;\n      &lt;noscript <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"js-progressiveMedia-inner\"</span>&gt;&amp;lt;img <span class=\"hljs-built_in\">class</span>=<span class=\"hljs-string\">\"progressiveMedia-noscript js-progressiveMedia-inner\"</span> src=<span class=\"hljs-string\">\"https://cdn-images-1.medium.com/max/331/1*eXEz9RrAjIWLz0MtQqq6Pg.jpeg\"</span>&amp;gt;&lt;/noscript&gt;\n     &lt;/<span class=\"hljs-keyword\">div</span>&gt;\n   &lt;/<span class=\"hljs-keyword\">div</span>&gt;\n  &lt;/figure&gt;\n</code></pre>\n<p>medium 用 canvas 来做那种模糊的效果估计是考虑到它的浏览器兼容性相对好一点，因为我这是移动端基本上兼容性的问题不考虑，所以想着可以不用 canvas 来做这个效果，直接用 css3 的 blur滤镜来实现这个模糊的效果。\n我的实现代码：</p>\n<pre><code>&lt;div <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span></span>=<span class=\"hljs-string\">\"container\"</span>&gt;\n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"img-placeholder\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\n    &lt;img <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span></span>=<span class=\"hljs-string\">\"img img-small J-webp\"</span> src=<span class=\"hljs-string\">\"/pj_appinvite/public/images/perch.jpg\"</span> data-large=<span class=\"hljs-string\">\"/pj_appinvite/public/images/body.jpg\"</span> alt=<span class=\"hljs-string\">\"\"</span>&gt;\n  <span class=\"xml\"><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\n</code></pre>\n<pre><code class=\"language-css\"><span class=\"hljs-selector-class\">.container</span> {\n  <span class=\"hljs-attribute\">background-color</span>: <span class=\"hljs-number\">#f6f6f6</span>;\n  <span class=\"hljs-attribute\">background-size</span>: cover;\n  <span class=\"hljs-attribute\">background-repeat</span>: no-repeat;\n  <span class=\"hljs-attribute\">position</span>: relative;\n  <span class=\"hljs-attribute\">overflow</span>: hidden;\n}\n\n<span class=\"hljs-selector-class\">.container</span> <span class=\"hljs-selector-tag\">img</span> {\n  <span class=\"hljs-attribute\">position</span>: absolute;\n  <span class=\"hljs-attribute\">opacity</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">top</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">left</span>: <span class=\"hljs-number\">0</span>;\n  <span class=\"hljs-attribute\">width</span>: <span class=\"hljs-number\">100%</span>;\n  <span class=\"hljs-attribute\">transition</span>: opacity <span class=\"hljs-number\">1s</span> linear;\n}\n\n<span class=\"hljs-selector-class\">.container</span> <span class=\"hljs-selector-tag\">img</span><span class=\"hljs-selector-class\">.loaded</span> {\n  <span class=\"hljs-attribute\">opacity</span>: <span class=\"hljs-number\">1</span>;\n}\n\n<span class=\"hljs-selector-class\">.img-small</span> {\n  <span class=\"hljs-attribute\">filter</span>: <span class=\"hljs-built_in\">blur</span>(50px);\n  <span class=\"hljs-attribute\">transform</span>: <span class=\"hljs-built_in\">scale</span>(1);\n}\n</code></pre>\n<pre><code class=\"language-js\"><span class=\"hljs-keyword\">const</span> imgSmall = <span class=\"hljs-built_in\">document</span>.querySelector(<span class=\"hljs-string\">'.img-small'</span>)\n<span class=\"hljs-keyword\">const</span> loadImage = (() =&gt; {\n  <span class=\"hljs-keyword\">const</span> img = <span class=\"hljs-keyword\">new</span> Image()\n  img.src = imgSmall.src\n  img.addEventListener(<span class=\"hljs-string\">'load'</span>, (e) =&gt; {\n    imgSmall.classList.add(<span class=\"hljs-string\">'loaded'</span>)\n  }, <span class=\"hljs-literal\">false</span>)\n  <span class=\"hljs-keyword\">const</span> imgLarge = <span class=\"hljs-keyword\">new</span> Image()\n  \n  imgLarge.src = imgSmall.dataset.large\n  imgLarge.addEventListener(<span class=\"hljs-string\">'load'</span>, (e) =&gt; {\n    imgLarge.classList.add(<span class=\"hljs-string\">'loaded'</span>)\n  }, <span class=\"hljs-literal\">false</span>)\n  imgSmall.parentNode.appendChild(imgLarge)\n})()\n</code></pre>\n<p>关于这样做的优点我就不说了，不过这里我觉得还有可以优化的地方，比如一开始加载的缩略图，因为现在就一个页面缩略图是自己弄得，但是\n如果真的用到一个完整的网站里面去，这个缩略图肯定不能人工手动去制作，可以利用一些云存储服务提供的功能定制缩略图的大小。\n还一个就是，缩略图虽然一般情况下是很小的，但是如果换成 base64 格式是不是速度会更快一点，或者换成 webp 方案的在某些情况下是不是也刚快一点。这些都是可以优化的地方。</p>\n<p>上面讲了实现类似 medium 那种图片加载效果，下面再记录下使用 webp 的方案。</p>\n<p>webp 方案在一开始做 HTML5 页面优化的时候就考虑了，但是在 iOS 上面的兼容问题一直没有正式用，但是我觉得不能因为 iOS 不支持，就不管安卓用户的体验，而且如果实现\n成本不高的话完全可以做的。所以我这就先用个活动试验了一下</p>\n<p>关于 webp 的兼容性可以在 caniuse 上看到：</p>\n<pre><code>WebP image <span class=\"hljs-built_in\">format</span> ✔ <span class=\"hljs-number\">61.31</span>% ◒ <span class=\"hljs-number\">1.31</span>% [Unofficial / Note]\n  Image <span class=\"hljs-built_in\">format</span> that supports lossy <span class=\"hljs-keyword\">and</span> lossless compression, <span class=\"hljs-keyword\">as</span> well <span class=\"hljs-keyword\">as</span> animation <span class=\"hljs-keyword\">and</span> alpha transparency. <span class=\"hljs-comment\">#Other</span>\n\n  IE ✘\n  Edge ✘\n  Firefox ✘\n  Chrome ✘ <span class=\"hljs-number\">4</span>+ ◒ <span class=\"hljs-number\">9</span>+¹ ✔ <span class=\"hljs-number\">23</span>+\n  Safari ✘\n  Opera ✘ <span class=\"hljs-number\">9</span>+ ◒ <span class=\"hljs-number\">11.1</span>+¹ ✔ <span class=\"hljs-number\">12</span>+\n\n    ¹Partial support <span class=\"hljs-keyword\">in</span> older Chrome, Opera <span class=\"hljs-keyword\">and</span> Android refers <span class=\"hljs-built_in\">to</span> browsers <span class=\"hljs-keyword\">not</span> supporting lossless <span class=\"hljs-keyword\">and</span> alpha versions <span class=\"hljs-keyword\">of</span> WebP.\n  ⓘ  Animated WebP images are supported <span class=\"hljs-keyword\">in</span> Chrome <span class=\"hljs-number\">32</span>+ <span class=\"hljs-keyword\">and</span> Opera <span class=\"hljs-number\">19</span>+.\n</code></pre>\n<p>因为涉及到兼容性问题，所以主要考虑的问题就是怎么做好 检测方案和切换方案。\n关于检测方案，google 官方也提供了方法，我这就直接借鉴过来了，大概逻辑就是 先请求一个 webp 格式的1x1大小图片，在\n监听图片 onload 或者 onerror 的时候判断。我们只要把第一次检测结果存起来就可以知道用户的设备支不支持 webp 格式了。\n这里我们用 localStorage 来存储用户是否支持 webp 格式的结果，localStorage的兼容性比 webp 好多啦，完全不用担心会存储结果不正确的\n问题。下面是基本代码：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-comment\">// 检查是否支持 webp，并将结果存在 localStorage 里</span>\n;(<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> (<span class=\"hljs-params\"></span>) </span>{\n  <span class=\"hljs-keyword\">if</span> (!<span class=\"hljs-built_in\">window</span>.localStorage || <span class=\"hljs-keyword\">typeof</span> localStorage !== <span class=\"hljs-string\">'object'</span>) <span class=\"hljs-keyword\">return</span>\n  <span class=\"hljs-keyword\">const</span> name = <span class=\"hljs-string\">'webpsupport'</span>\n  <span class=\"hljs-keyword\">if</span> (!localStorage.getItem(name) ||\n    (localStorage.getItem(name) !== <span class=\"hljs-string\">'true'</span> &amp;&amp;\n      localStorage.getItem(name) !== <span class=\"hljs-string\">'false'</span>)) {\n    <span class=\"hljs-keyword\">var</span> img = <span class=\"hljs-keyword\">new</span> Image()\n    img.src = <span class=\"hljs-string\">'data:image/webp;base64,UklGRkoAAABXRUJQVlA4WAoAAAAQAAAAAAAAAAAAQUxQSAsAAAABBxAREYiI/gcAAABWUDggGAAAADABAJ0BKgEAAQABABwlpAADcAD+/gbQAA=='</span>\n    img.onload = <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> (<span class=\"hljs-params\"></span>) </span>{\n      localStorage.setItem(name, <span class=\"hljs-string\">'true'</span>)\n    }\n    img.onerror = <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> (<span class=\"hljs-params\"></span>) </span>{\n      localStorage.setItem(name, <span class=\"hljs-string\">'false'</span>)\n    }\n  }\n}())\n</code></pre>\n<p>为了避免额外的请求，我们把检测用的图片换成 base64 格式的。检测方案基本搞定了下面就是怎么用了，在支持和不支持之间怎么切换，我还是在上面那个活动页面的代码\n基础上修改。</p>\n<pre><code class=\"language-HTML\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"container\"</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"img-placeholder\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">img</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"img img-small\"</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"/pj_appinvite/public/images/perch.jpg\"</span> <span class=\"hljs-attr\">data-large</span>=<span class=\"hljs-string\">\"/pj_appinvite/public/images/body.jpg\"</span> <span class=\"hljs-attr\">data-largewebp</span>=<span class=\"hljs-string\">\"/pj_appinvite/public/images/body.jpg.webp\"</span> <span class=\"hljs-attr\">alt</span>=<span class=\"hljs-string\">\"\"</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n</code></pre>\n<pre><code class=\"language-js\">\n  <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">getWebpSrc</span>(<span class=\"hljs-params\">imgsrc,webpimgsrc</span>) </span>{\n    <span class=\"hljs-keyword\">var</span> needwebp = <span class=\"hljs-literal\">false</span>,\n        src = <span class=\"hljs-string\">''</span>\n    <span class=\"hljs-keyword\">if</span> (<span class=\"hljs-built_in\">window</span>.localStorage &amp;&amp; <span class=\"hljs-keyword\">typeof</span> localStorage === <span class=\"hljs-string\">'object'</span>) {\n      needwebp = localStorage.getItem(<span class=\"hljs-string\">'webpsupport'</span>) === <span class=\"hljs-string\">'true'</span>\n    }\n    src = needwebp ? webpimgsrc : imgsrc\n    <span class=\"hljs-keyword\">return</span> src\n  }\n\n  <span class=\"hljs-keyword\">const</span> imgSmall = <span class=\"hljs-built_in\">document</span>.querySelector(<span class=\"hljs-string\">'.img-small'</span>)\n  <span class=\"hljs-keyword\">const</span> loadImage = (() =&gt; {\n    <span class=\"hljs-keyword\">const</span> img = <span class=\"hljs-keyword\">new</span> Image()\n    img.src = imgSmall.src\n    img.addEventListener(<span class=\"hljs-string\">'load'</span>, (e) =&gt; {\n      imgSmall.classList.add(<span class=\"hljs-string\">'loaded'</span>)\n    }, <span class=\"hljs-literal\">false</span>)\n    <span class=\"hljs-keyword\">const</span> imgLarge = <span class=\"hljs-keyword\">new</span> Image()\n    imgLarge.src = getWebpSrc(imgSmall.dataset.large,imgSmall.dataset.largewebp)\n  \n    imgLarge.addEventListener(<span class=\"hljs-string\">'load'</span>, (e) =&gt; {\n      imgLarge.classList.add(<span class=\"hljs-string\">'loaded'</span>)\n    }, <span class=\"hljs-literal\">false</span>)\n    imgSmall.parentNode.appendChild(imgLarge)\n  })()\n</code></pre>\n<p>我分别把jpg, webp 格式的图片通过 data 属性存起来，然后通过 getWebpSrc 函数去 localStorage里取该用户设备支不支持\nwebp，如果支持我们就取 webp 格式的链接，不支持则取 jpg 格式的，一开始我只是把 jpg 格式的图片放在 data 属性里，\n然后在 getWebpSrc函数里通过给支持 webp 格式的在 jpg 图片后面添加 .webp 格式后缀即可，但是因为我们的图片上传到又拍云\n之后在构建那一层给图片地址加了一串 hash 字符串，导致不能简单添加后缀就可以实现，所以还是选择把两个图片格式的地图都存起来，这样稳一点。</p>\n<p>还有一点就是因为我这里是一个页面，没有用到图片懒加载的效果，所以如果在用到懒加载的页面可以把 getWebpSrc 函数加到那个懒加载图片的实现代码里。</p>\n<p>最后一点就是现在 webp 格式的图片我都是通过 cwebp 命令在终端生成的，所以这部分还是得我们手工完成，如果有图片云服务商提供\n生成 webp 格式的方案就好了。</p>\n<p>整个活动页面加上这两个优化点再结合之前做的我感觉已经差不多了</p>\n"}

