	module.exports = {"layout":"post","title":"我们编写 React 组件的最佳实践【译】","datePublished":"2017-03-25 11:21:04","category":"React","body":"<p>之前看到 Medium 上的一篇文章，写的还可以，拖了很久打算翻译一下。\n<a href=\"https://engineering.musefind.com/our-best-practices-for-writing-react-components-dec3eb5c3fc8\">https://engineering.musefind.com/our-best-practices-for-writing-react-components-dec3eb5c3fc8</a></p>\n<p><img src=\"https://cdn-images-1.medium.com/max/800/1*GEniDHmmO0nkVuKQ8fhLYw.png\" alt=\"\"></p>\n<p>在我刚开始写 React 的时候，我记得看过许多不同的方法来写组件，每个教程都大不相同。虽然那个时候 React 已经变得相当的成熟，但似乎并没有一种明确的编写写组件的“正确”方式。</p>\n<p>过去一年在 <a href=\"https://musefind.com/\">MuseFind</a> 中，我们的团队写过了很多的 React 组件。我们也在不断的改善方法直到我们满意为止。</p>\n<p>这篇指南代表作是我们建议的编写 React 组件的最佳方式。我们希望它对你有用，不管你是初学者还是有经验的人。</p>\n<p>在开始之前，一些注意事项：</p>\n<ul>\n<li>我们使用 ES6 和 ES7 语法。</li>\n<li>如果你还不清楚展示组件和容器组件，我们建议先读<a href=\"https://medium.com/@dan_abramov/smart-and-dumb-components-7ca2f9a7c7d0#.kuvqndiqq\">这篇</a>.</li>\n<li>如果你有啥建议和问题以及反馈，请在下面评论指出。</li>\n</ul>\n<h2>基于 Class 类的组件</h2>\n<p>基于类的组件包含了状态和方法。我们应该尽量保守的去使用它们，但是这类组件有他们的用武之地。</p>\n<p>接下来，我们来逐行地构建我们的组件</p>\n<h4>引入 CSS</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> EexpandableFormRequiredPropsxpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n</code></pre>\n<p>我理论上比较倾向 <a href=\"https://medium.freecodecamp.com/a-5-minute-intro-to-styled-components-41f40eb7cd55\">CSS in JavaScript</a>，但是这还是一个比较新的想法，到目前为止并没有一个相对成熟的解决方法出现。所以目前，我们对每一个组件都引入 CSS 文件。</p>\n<p>我们用空行把本地引入和依赖引入分开。</p>\n<h4>初始化 State</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> ExpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  state = { expanded: <span class=\"hljs-literal\">false</span> }\n</code></pre>\n<p>如果你使用 ES6 而不是 ES7，请在构造方法里初始化状态。除此之外，你可以在 ES7 中使用上面的方法初始化状态。更多信息，请移步<a href=\"http://stackoverflow.com/questions/35662932/react-constructor-es6-vs-es7\">这里</a>。</p>\n<p>当然，我们还需将我们的类作为默认类导出。</p>\n<h4>propTypes 和 defaultProps</h4>\n<pre><code class=\"language-javascript\">\n<span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> ExpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  state = { expanded: <span class=\"hljs-literal\">false</span> }\n\n  <span class=\"hljs-keyword\">static</span> propTypes = {\n    model: React.PropTypes.object.isRequired,\n    title: React.PropTypes.string\n  }\n\n  <span class=\"hljs-keyword\">static</span> defaultProps = {\n    model: {\n      id: <span class=\"hljs-number\">0</span>\n    },\n    title: <span class=\"hljs-string\">'Your Name'</span>\n  }\n</code></pre>\n<p>propTypes 和 defaultProps 是静态的属性，需要尽可能早的在组件代码中声明。因为它们是作为文档而存在的，所以当其他开发者在阅读代码时候，它们应该尽早被看到。</p>\n<p>所有的组件都应该有 propTypes。</p>\n<h4>Methods 方法</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> ExpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  state = { expanded: <span class=\"hljs-literal\">false</span> }\n\n  <span class=\"hljs-keyword\">static</span> propTypes = {\n    model: React.PropTypes.object.isRequired,\n    title: React.PropTypes.string\n  }\n\n  <span class=\"hljs-keyword\">static</span> defaultProps = {\n    model: {\n      id: <span class=\"hljs-number\">0</span>\n    },\n    title: <span class=\"hljs-string\">'Your Name'</span>\n  }\n\n  handleSubmit = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.props.model.save()\n  }\n\n  handleNameChange = (e) =&gt; {\n    <span class=\"hljs-keyword\">this</span>.props.model.name = e.target.value\n  }\n\n  handleExpand = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.setState({ expanded: !<span class=\"hljs-keyword\">this</span>.state.expanded })\n  }\n</code></pre>\n<p>在基于类的组件中，当你需要向子组件传递方法的时候，你应该确保他们被调用的时候正确地绑定了 <em>this</em>。通常可以由 <em>this.handleSubmit.bind(this)</em> 传递给子组件来实现。</p>\n<p>我们认为这种方法更简洁易用，通过 ES6 的箭头函数来自动确保正确的上下文。</p>\n<h4>设置函数式 setState</h4>\n<p>在上面的例子里我们是这样修改 state 的：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-keyword\">this</span>.setState({ expanded: !<span class=\"hljs-keyword\">this</span>.state.expanded })\n</code></pre>\n<p>我们都知道 setState 是异步的，在我们调用 setState 后是没办法立即获取新的 state 值的。</p>\n<p>这里有个办法就是通过设置函数式 setState，把之前的 state值通过参数传进来：</p>\n<pre><code class=\"language-js\"><span class=\"hljs-keyword\">this</span>.setState(prevState =&gt; ({ expanded: !prevState.expanded }))\n</code></pre>\n<h4>解构 Props</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> ExpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  state = { expanded: <span class=\"hljs-literal\">false</span> }\n\n  <span class=\"hljs-keyword\">static</span> propTypes = {\n    model: React.PropTypes.object.isRequired,\n    title: React.PropTypes.string\n  }\n\n  <span class=\"hljs-keyword\">static</span> defaultProps = {\n    model: {\n      id: <span class=\"hljs-number\">0</span>\n    },\n    title: <span class=\"hljs-string\">'Your Name'</span>\n  }\n\n  handleSubmit = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.props.model.save()\n  }\n\n  handleNameChange = (e) =&gt; {\n    <span class=\"hljs-keyword\">this</span>.props.model.name = e.target.value\n  }\n\n  handleExpand = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.setState(prevState =&gt; ({ expanded: !prevState.expanded }))\n  }\n\n  render() {\n    <span class=\"hljs-keyword\">const</span> {\n      model,\n      title\n    } = <span class=\"hljs-keyword\">this</span>.props\n    <span class=\"hljs-keyword\">return</span> ( \n      <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ExpandableForm</span> \n        <span class=\"hljs-attr\">onSubmit</span>=<span class=\"hljs-string\">{this.handleSubmit}</span> \n        <span class=\"hljs-attr\">expanded</span>=<span class=\"hljs-string\">{this.state.expanded}</span> \n        <span class=\"hljs-attr\">onExpand</span>=<span class=\"hljs-string\">{this.handleExpand}</span>&gt;</span>\n        <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span>&gt;</span>\n          <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h1</span>&gt;</span>{title}<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h1</span>&gt;</span>\n          <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">input</span>\n            <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text\"</span>\n            <span class=\"hljs-attr\">value</span>=<span class=\"hljs-string\">{model.name}</span>\n            <span class=\"hljs-attr\">onChange</span>=<span class=\"hljs-string\">{this.handleNameChange}</span>\n            <span class=\"hljs-attr\">placeholder</span>=<span class=\"hljs-string\">\"Your Name\"</span>/&gt;</span>\n        <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n      <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ExpandableForm</span>&gt;</span>\n    )\n  }\n}\n</span></code></pre>\n<p>有多个 props 的组件应该每行只写一个 prop，就像上面一样。</p>\n<h4>装饰器</h4>\n<pre><code class=\"language-javascript\">@observer\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n</code></pre>\n<p>如果你使用了像<a href=\"https://github.com/mobxjs/mobx\">mobx</a>的工具，你可以像上面这样来装饰组件，这和把组件传递到函数一样。</p>\n<p><a href=\"http://javascript.info/tutorial/decorators\">装饰器</a> 是一种灵活可读的用来修饰组件功能的方法，配合 mobx 和 我们自己的 <a href=\"https://github.com/musefind/mobx-models\">mobx-models</a> 库，我们可以广泛的应用这种方法。</p>\n<p>如果你不想使用装饰器，可以这么做：</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  <span class=\"hljs-comment\">// Component code</span>\n}\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> observer(ProfileContainer)\n</code></pre>\n<h4>闭包</h4>\n<p>避免向子组件传递新的闭包，比如:</p>\n<pre><code class=\"language-javascript\">&lt;input\n  type=<span class=\"hljs-string\">\"text\"</span>\n  value={model.name}\n  <span class=\"hljs-comment\">// onChange={(e) =&gt; { model.name = e.target.value }}</span>\n  <span class=\"hljs-comment\">// ^ Not this. Use the below:</span>\n  onChange={<span class=\"hljs-keyword\">this</span>.handleChange}\n  placeholder=<span class=\"hljs-string\">\"Your Name\"</span>/&gt;\n</code></pre>\n<p>原因在此：每次父级组件渲染的时候，一个新的函数就会被创建，传递到 input 中。</p>\n<p>如果这里的 input 是一个 React 组件，这会自动触发该组件重新渲染，不管该组件当中的 props 有没有被改变。</p>\n<p>子级校正 （Reconciliation） 是 React 框架中最耗资源的部分。如果不需要，就不要增加难度。而且传递一个类方法会使代码更易于阅读，易于调试，易于修改。</p>\n<p>以下是组件的全貌：</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React, {Component} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n<span class=\"hljs-comment\">// Separate local imports from dependencies</span>\n<span class=\"hljs-keyword\">import</span> ExpandableForm <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'./ExpandableForm'</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/ProfileContainer.css'</span>\n\n<span class=\"hljs-comment\">// Use decorators if needed</span>\n@observer\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ProfileContainer</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">Component</span> </span>{\n  state = { expanded: <span class=\"hljs-literal\">false</span> }\n  <span class=\"hljs-comment\">// Initialize state here (ES7) or in a constructor method (ES6)</span>\n \n  <span class=\"hljs-comment\">// Declare propTypes as static properties as early as possible</span>\n  <span class=\"hljs-keyword\">static</span> propTypes = {\n    model: React.PropTypes.object.isRequired,\n    title: React.PropTypes.string\n  }\n\n  <span class=\"hljs-comment\">// Default props below propTypes</span>\n  <span class=\"hljs-keyword\">static</span> defaultProps = {\n    model: {\n      id: <span class=\"hljs-number\">0</span>\n    },\n    title: <span class=\"hljs-string\">'Your Name'</span>\n  }\n\n  <span class=\"hljs-comment\">// Use fat arrow functions for methods to preserve context (this will thus be the component instance)</span>\n  handleSubmit = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.props.model.save()\n  }\n  \n  handleNameChange = (e) =&gt; {\n    <span class=\"hljs-keyword\">this</span>.props.model.name = e.target.value\n  }\n  \n  handleExpand = (e) =&gt; {\n    e.preventDefault()\n    <span class=\"hljs-keyword\">this</span>.setState(prevState =&gt; ({ expanded: !prevState.expanded }))\n  }\n  \n  render() {\n    <span class=\"hljs-comment\">// Destructure props for readability</span>\n    <span class=\"hljs-keyword\">const</span> {\n      model,\n      title\n    } = <span class=\"hljs-keyword\">this</span>.props\n    <span class=\"hljs-keyword\">return</span> ( \n      <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ExpandableForm</span> \n        <span class=\"hljs-attr\">onSubmit</span>=<span class=\"hljs-string\">{this.handleSubmit}</span> \n        <span class=\"hljs-attr\">expanded</span>=<span class=\"hljs-string\">{this.state.expanded}</span> \n        <span class=\"hljs-attr\">onExpand</span>=<span class=\"hljs-string\">{this.handleExpand}</span>&gt;</span>\n        // Newline props if there are more than two\n        <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span>&gt;</span>\n          <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h1</span>&gt;</span>{title}<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h1</span>&gt;</span>\n          <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">input</span>\n            <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text\"</span>\n            <span class=\"hljs-attr\">value</span>=<span class=\"hljs-string\">{model.name}</span>\n            // <span class=\"hljs-attr\">onChange</span>=<span class=\"hljs-string\">{(e)</span> =&gt;</span> { model.name = e.target.value }}\n            // Avoid creating new closures in the render method- use methods like below\n            onChange={this.handleNameChange}\n            placeholder=\"Your Name\"/&gt;\n        <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n      <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ExpandableForm</span>&gt;</span>\n    )\n  }\n}\n</span></code></pre>\n<h2>函数组件</h2>\n<p>这部分组件没有状态和方法。此类组件比较纯粹，易于理解。尽量多使用这类组件。</p>\n<h4>propTypes</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/Form.css'</span>\n\n<span class=\"hljs-keyword\">const</span> expandableFormRequiredProps = {\n  onSubmit: React.PropTypes.func.isRequired,\n  expanded: React.PropTypes.bool\n}\n\n<span class=\"hljs-comment\">// Component declaration</span>\n</code></pre>\n<p>这里，我们在文件最开始给变量赋值 propTypes，所以它们立即可见。在下面的组件声明中，我们来更恰当地赋值。</p>\n<h4>解构 Props 和 defaultProps</h4>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/Form.css'</span>\n\n<span class=\"hljs-keyword\">const</span> expandableFormRequiredProps = {\n  onSubmit: React.PropTypes.func.isRequired,\n  expanded: React.PropTypes.bool\n}\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">ExpandableForm</span>(<span class=\"hljs-params\">props</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> (\n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">form</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{props.expanded</span> ? {<span class=\"hljs-attr\">height:</span> '<span class=\"hljs-attr\">auto</span>'} <span class=\"hljs-attr\">:</span> {<span class=\"hljs-attr\">height:</span> <span class=\"hljs-attr\">0</span>}}&gt;</span>\n      {props.children}\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">button</span> <span class=\"hljs-attr\">onClick</span>=<span class=\"hljs-string\">{props.onExpand}</span>&gt;</span>Expand<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">button</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">form</span>&gt;</span></span>\n  )\n}\n</code></pre>\n<p>我们的组件是一个函数，其中 props 作为参数。我们可以像下面这样把它展开：</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/Form.css'</span>\n\n<span class=\"hljs-keyword\">const</span> expandableFormRequiredProps = {\n  onExpand: React.PropTypes.func.isRequired,\n  expanded: React.PropTypes.bool\n}\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">ExpandableForm</span>(<span class=\"hljs-params\">{ onExpand, expanded = false, children }</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> (\n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">form</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{</span> <span class=\"hljs-attr\">expanded</span> ? { <span class=\"hljs-attr\">height:</span> '<span class=\"hljs-attr\">auto</span>' } <span class=\"hljs-attr\">:</span> { <span class=\"hljs-attr\">height:</span> <span class=\"hljs-attr\">0</span> } }&gt;</span>\n      {children}\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">button</span> <span class=\"hljs-attr\">onClick</span>=<span class=\"hljs-string\">{onExpand}</span>&gt;</span>Expand<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">button</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">form</span>&gt;</span></span>\n  )\n}\n</code></pre>\n<p>注意我们可以通过更可读的方式来使用默认参数作为 defaultProps。如果 expanded 没有被定义，我们设定它为 false。（一种更合理的解释是，虽然它是布尔类型，但是可以避免出现 ‘Cannot read &lt; property &gt; of undefined’ 此类对象错误的问题）。</p>\n<p>避免使用如下的 ES6 语法：</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">const</span> ExpandableForm = ({ onExpand, expanded, children }) =&gt; {\n</code></pre>\n<p>看起来非常得时髦，但这里的函数实际上未命名。</p>\n<p>如果Babel设置正确，这里未命名不会造成问题。但是如果Babel设置错了的话，任何错误都会以 &lt;&lt; anonymous &gt;&gt; 的方式呈现，这对于调错是非常糟糕的体验。</p>\n<p>未命名的函数也可以会伴随 Jest （一个 React 测试库）出现问题。由于这些难以理解的 bugs 的潜在问题，我们建议使用 <em>function 代替 const.</em></p>\n<h4>封装</h4>\n<p>既然你不能对函数组件使用装饰器，你可以把函数作为参数传递过去。</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/Form.css'</span>\n\n<span class=\"hljs-keyword\">const</span> expandableFormRequiredProps = {\n  onExpand: React.PropTypes.func.isRequired,\n  expanded: React.PropTypes.bool\n}\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">ExpandableForm</span>(<span class=\"hljs-params\">{ onExpand, expanded = false, children }</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> (\n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">form</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{</span> <span class=\"hljs-attr\">expanded</span> ? { <span class=\"hljs-attr\">height:</span> '<span class=\"hljs-attr\">auto</span>' } <span class=\"hljs-attr\">:</span> { <span class=\"hljs-attr\">height:</span> <span class=\"hljs-attr\">0</span> } }&gt;</span>\n      {children}\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">button</span> <span class=\"hljs-attr\">onClick</span>=<span class=\"hljs-string\">{onExpand}</span>&gt;</span>Expand<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">button</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">form</span>&gt;</span></span>\n  )\n}\n\nExpandableForm.propTypes = expandableFormRequiredProps\n\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> observer(ExpandableForm)\n</code></pre>\n<p>以下是组件的全貌：</p>\n<pre><code class=\"language-javascript\"><span class=\"hljs-keyword\">import</span> React <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'react'</span>\n<span class=\"hljs-keyword\">import</span> {observer} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'mobx-react'</span>\n<span class=\"hljs-comment\">// Separate local imports from dependencies</span>\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-string\">'./styles/Form.css'</span>\n\n<span class=\"hljs-comment\">// Declare propTypes here as a variable, then assign below function declaration </span>\n<span class=\"hljs-comment\">// You want these to be as visible as possible</span>\n<span class=\"hljs-keyword\">const</span> expandableFormRequiredProps = {\n  onSubmit: React.PropTypes.func.isRequired,\n  expanded: React.PropTypes.bool\n}\n\n<span class=\"hljs-comment\">// Destructure props like so, and use default arguments as a way of setting defaultProps</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">ExpandableForm</span>(<span class=\"hljs-params\">{ onExpand, expanded = false, children }</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> (\n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">form</span> <span class=\"hljs-attr\">style</span>=<span class=\"hljs-string\">{</span> <span class=\"hljs-attr\">expanded</span> ? { <span class=\"hljs-attr\">height:</span> '<span class=\"hljs-attr\">auto</span>' } <span class=\"hljs-attr\">:</span> { <span class=\"hljs-attr\">height:</span> <span class=\"hljs-attr\">0</span> } }&gt;</span>\n      {children}\n      <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">button</span> <span class=\"hljs-attr\">onClick</span>=<span class=\"hljs-string\">{onExpand}</span>&gt;</span>Expand<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">button</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">form</span>&gt;</span></span>\n  )\n}\n\n<span class=\"hljs-comment\">// Set propTypes down here to those declared above</span>\nExpandableForm.propTypes = expandableFormRequiredProps\n\n<span class=\"hljs-comment\">// Wrap the component instead of decorating it</span>\n<span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> observer(ExpandableForm)\n</code></pre>\n<h2>JSX 中的条件语句</h2>\n<p>如果你要使用很多有条件限制的渲染，这里是你需要避免的：</p>\n<p><img src=\"https://cdn-images-1.medium.com/max/800/1*4zdSbYcOXTVchgSJqtk0Ig.png\" alt=\"\"></p>\n<p>内嵌套的三元运算符不是一个好想法。</p>\n<p>虽然有一些第三方的库解决这个问题（<a href=\"https://github.com/AlexGilleran/jsx-control-statements\">JSX-Control Statements</a>），但这里我们用下面的方法来解决复杂的条件语句，而不去引用这些依赖。</p>\n<p><img src=\"https://cdn-images-1.medium.com/max/800/1*IVFlMaSGKqHISJueTC26sw.png\" alt=\"\"></p>\n<p>使用花括号包装一个 <a href=\"http://stackoverflow.com/questions/8228281/what-is-the-function-construct-in-javascript\">IIFE</a>，然后把 if 语句放进去，返回你想渲染的任何东西。注意 IIFE 可能会导致性能问题，但是在绝大多数情况下，它导致的性能问题还不足以与代码可读性问题相比。</p>\n<p>更新：许多评论推荐把这些逻辑抽取为一个子组件，根据 props 返回不同的 button。这是对的，尽肯能的把你的组件切割，但是记住把 IIFE 作为一个降级的处理方法。</p>\n<p>同样，当你只想在一个条件语句中渲染某个元素，不要这么做：</p>\n<pre><code class=\"language-javascript\">{\n  isTrue\n   ? <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">p</span>&gt;</span>True!<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">p</span>&gt;</span></span>\n   : <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">none</span>/&gt;</span></span>\n}\n</code></pre>\n<p>应该使用短路求值（short-circuit evaluation）的方式</p>\n<pre><code class=\"language-javascript\">{\n  isTrue &amp;&amp; \n    <span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">p</span>&gt;</span>True!<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">p</span>&gt;</span></span>\n}\n</code></pre>\n"}

