	module.exports = {"title":"use","layout":"page","path":"/use","body":"<h2>用的一些东西</h2>\n<h4>在用的一些硬件</h4>\n<ul>\n<li>笔记本：MacBook Pro (15-inch, Late 2016)</li>\n<li>显示器：DELL P2415Q</li>\n<li>手机：iPhonXR</li>\n<li>手表：iWatch 4</li>\n<li>阅读：Kindle 4代</li>\n<li>机械键盘：Filco 圣手二代侧刻</li>\n<li>鼠标：罗技轨迹球 M570、雷柏 MT750S</li>\n<li>移动硬盘：SAMSUNG T5</li>\n</ul>\n<h4>科学上网</h4>\n<ul>\n<li>Google Cloud 搭的梯子和 vultr 搭的梯子、公司的梯子</li>\n</ul>\n<h4>一些常用的 Mac 软件</h4>\n<ul>\n<li>浏览器：Google Chrome、Google Chrome Canary、TorBrowser</li>\n<li>编辑器/IDE：VSCode、Vim、IntelliJ、PyCharm、XCode</li>\n<li>编程字体：Dank Mono</li>\n<li>命令行终端：iTerm2 + zsh + oh-my-zsh + 一堆插件</li>\n<li>邮件：网易邮箱大师 管理 Gmail，QQ、企业邮件等</li>\n<li>RSS: Reeder3 + inoreader</li>\n<li>笔记：印象笔记 + Bear</li>\n<li>个人项目管理：Trello</li>\n<li>Git 客户端：SourceTree (偶尔使用)</li>\n<li>密码管理：Enpass</li>\n<li>快捷工具：Alfred3</li>\n<li>分屏工具：Magent</li>\n</ul>\n"}

